      SELECT DISTINCT col0 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) BETWEEN - - 14 * + 17 + - col1 + col1 + - col2 AND + 25;
  - name: tab1

outputs:
  - name: q4742.out
    data: |
